import styled from "styled-components";
import { Navbar } from "../Navbar";
import { Sidebar } from "../Sidebar";
const Menu = styled.div`
  width: 100%;
`;

export function Index() {
  return (
    <>
      <Menu>
        <Navbar />
      </Menu>
      <Sidebar />
    </>
  );
}
